import React from "react";

const style = {
    box: {
        width: '152px',
        height: '215px',
    },
    img: {
        width: '152px',
        height: '215px'
    }
}

function ViewMainList(props) {

    return (
        <div className={'container my-5'}>
            <div className={'row'}>
                <div className={'col-sm-auto m-3'} style={style.box}>
                    <img src={'/image/1.png'} style={style.img} />
                </div>
                <div className={'col-sm'} id={''}>
                    <div id={''}>
                        <a href={'#'} className={''} onClick={''}>Title</a>
                        <span className={'ms-2'}>subTitle</span>
                    </div>
                    <div>
                        <span>
                            {/*지은이 그림 옮긴이 등 받아오는 api정보에 맞게 a태그가 추가될 필요가 있어보임*/}
                            <a href={'#'} className={''} onClick={''}>지은이</a> |
                            <span className={''}> 출판일</span>
                        </span>
                    </div>
                </div>
                <div className={'col-sm'}>
                    <button type={'button'} className={'btn text-center'} name={''} onClick={''}>중고도서보기</button>
                    <br/>
                    <button type={'button'} className={'btn text-center'} name={''} onClick={''}>장바구니 담기</button>
                    <br/>
                    <button type={'button'} className={'btn text-center'} name={''} onClick={''}>중고도서판매하기</button>
                </div>
            </div>
        </div>
    )
}

export default ViewMainList;
